import React from 'react'

const CharacterCard = ({ characters }) => {
    return (
        <div>
            <section className='cards'>
                {characters.map(character => 
                <h1>{character.name}</h1>,
                <img src={character.image} alt=""/>    
                )}
            </section>
        </div>
    )
}

export default CharacterCard
